      commentary: {
        numLines: 3,
        text: {
          textDirection: "FIRST_STRONG",
          text: "I was on a sales call, and the client told me that instead of a retainer, they want to do a 30-day optimization sprint. Here's what I told them ‚§µ\n\nSEO is like fitness\n\n‚Üí You can't expect to get and stay fit in a week.\n‚Üí You can't expect to eat healthily once and get in shape.\n‚Üí You can't expect to get fit while someone else does the work.\n\nLikewise:\n\n‚Ü≥¬†You can't expect to rank and retain top positions in a week.\n‚Ü≥¬†You can't expect to do SEO once and get results forever.\n‚Ü≥¬†You can't expect to rank while doing nothing yourself.\n\nIn fitness:\n\n1) You need a regime that is right for your body.\n\nStart by getting a personal trainer to analyze your current state (strengths and weaknesses), understand your goals, and provide a plan by selecting the right combination of exercises.\n\n2) You need to exercise frequently to hit your goals.\n\nBuild out your regime, allocate time in your diary, and remain consistent when executing.\n\n3) You need to fuel your body with the right diet.\n\nProduce a diet plan by getting creative with your portioned meals and make sure you have a variety of snacks with the correct macros/energy levels to consume on the go.\n\n4) You need to continually exercise to remain fit.\n\nKeep exercising to retain your current shape, but don't forget to try new exercises that fit your regime.\n\nIn SEO:\n\n1) You need a strategy that is right for your website.\n\nStart by getting an SEO strategist to analyze your current state (website and backlink profile), understand your goals, and provide a plan by selecting the right combination of strategies.\n\n2) You need to execute frequently to hit your goals.\n\nBuild out your strategies into detailed tasks, allocate resources to execute, and remain consistent in your execution (especially link building).\n\n3) You need to fuel your website with the right content.\n\nProduce a targeted content plan by getting creative with your topic ideas and make sure you have a variety of content types with the correct keywords/traffic potential to publish frequently.\n\n4) You need to continue link building to remain top.\n\nKeep building links to retain your positions, but don't forget to try new strategies that fit your campaign.\n\nSEO is a never-ending process. Just like fitness.",
        },
      },
