        text: {
          textDirection: "FIRST_STRONG",
          text: "I have personally penned over 200 articles that have been featured in some of the world's largest publications. \n\nHere are the 14 rules of Internet writing that helped me get there:\n\n1. Tell a story.\n2. Ditch the long intros.\n3. Write how you speak.\n4. Make your headline last.\n5. Use emotions to drive sales.\n6. Get straight to the damn point.\n7. Write, rewrite, and trim the fat.\n8. Never assume prior knowledge.\n9. Desert cliches and granny rules.\n10. Focus on benefits, not the features.\n11. Provide action with your information.\n12. Paint vivid pictures with your vocabulary.\n13. Use short words, sentences, paragraphs.\n14. Know your audience before you write for them.\n15. Tease your conclusion within your introduction.\n16. Leave one piece unpublished for a day, then edit it.\n17. Assure every part of your writing serves a purpose.\n18. Focus mind-blowing first, pleasant-reading second.\n\nWhich rules would you add?",
        },
