      commentary: {
        numLines: 3,
        text: {
          textDirection: "FIRST_STRONG",
          text: "1 + 1 = 3. That's the formula for partnerships.\n\n\nI've just started a project in partnership with someone much more experienced and skilled than myself. \n\nHe adds value I can't buy, and I give the same in return in a different domain.\n\nI've seen too many people start up with great ideas that fail because they chose the wrong partners, and I have been one of them too.\n\nHere's what my three successfully failed partnerships have taught me.\n\nNever partner with someone:\n\n‚Ü≥ You can hire.\n‚Ü≥ Is closed to criticism.\n‚Ü≥ Whose skills overlap yours.\n‚Ü≥ Whose work ethic falls short of yours.\n‚Ü≥ Who can't complement your weaknesses.\n‚Ü≥ Whose business vision differs from yours.\n‚Ü≥ Less invested in the venture's success than you.\n‚Ü≥ You can't trust to run the business in your absence.\n‚Ü≥ You can't avoid if you don't end up working together.\n\nStop getting into partnerships you can't see working for over a decade. If you think something can go wrong, it most likely will.\n\nGet serious and take the risk yourself unless you find a partner you can't hire.",
        },
      },
